import React from "react";
import { Link } from "react-router-dom";

export default function TeamComp({ teams }) {
  return (
    <>
      <h3>Teams List</h3>
      <div className="team-list">
        {teams.map((team, i) => {
          return (
            <div className="team-list_wrap">
              {team.division === "Northwest" ? (
                <Link key={i} to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              ) : null}
            </div>
          );
        })}
      </div>
    </>
  );
}
